import './App.css';
import FirstScreen from './components/firstScreen/firstScreen';
import SecondScreen from './components/secondScreen/secondScreen';

function App() {

  let component

  switch (window.location.pathname) {
    case "/": break
    case "/firstScreen":
      component = <FirstScreen />
      break
    case "/secondScreen":
      component = <SecondScreen />
      break
  }

  return (
    <div className="App">

      <a href="/firstScreen"> GoToFirst</a>
      <a href="/secondScreen"> GoToSecond</a>
      <p>{component}</p>

    </div>
  );
}

export default App;
